I'm trying to use the new mock-mode in the latest version of o1js. However, I notice that when I do the privateInputs that I'm passing in are ignored and a fixed argument of `[0]` is used instead, which is then causing the method body to fail as this isn't what's expected. Here's a simple example.
```const MyProgram = ZkProgram({
      name: "example-without-proving",
      publicOutput: Field,
      publicInput: Field,
      methods: {
        baseCase: {
          privateInputs: [Field],
          async method(input: Field, priInp: Field) {
            return {
              publicOutput: priInp.add(4),
            };
          },
        },
      },
    });

    await MyProgram.compile();
    MyProgram.setProofsEnabled(false);
    const result = await MyProgram.baseCase(Field(77), Field(11));
```
Am I doing something wrong?  Thanks cc@gregor @Florian

